import React from "react";

class Users extends React.Component {
  users = [
    {
      id: 1,
      firstname: "Vadim",
      lastname: "Khakimyanov",
      bio: 'Программист получаеца',
      age: 27,
      isHappy: true
  },
  {
      id: 2,
      firstname: "Ruslan",
      lastname: "Melnikov",
      bio: 'Промоутер получаеца',
      age: 18,
      isHappy: true
},
{
  id: 3,
  firstname: "Naruto",
  lastname: "Uzumaki",
  bio: 'Хокаге получаеца',
  age: 35,
  isHappy: false
},
  ]
  render() {
    if (this.users.length > 0)
      return (
        <div>
          {this.users.map((e) => (<div key={e.id}>
              <div className="bg-users">
                  <h5>{e.id}. {e.firstname} {e.lastname} (возраст {e.age} лет)</h5>
                  {e.bio}
                  <br />
                  Заработок: {e.isHappy ? "Все гуд" : "Все плоха"}
                  </div>
          </div>))}
      </div>)

  else 
    return (<div className="bg-users">
                  <h3>Все уехали</h3>
          </div>)
  }
}

export default Users
